import React from 'react'
import styled from 'styled-components'

 export const Sidebar = styled.div`
    width: 250px;
    position: fixed;
    top: 0;
    left: 0;
    height: 100vh;
    z-index: 999;
    background: #3256D4;
    color: #fff;
    transition: all 0.3s;

`
export const NavLink = styled.h2`
    color: #ffffff;
    
    
`

function AdminPanel() {
    return (
        <Sidebar>
            <NavLink >ORDERS</NavLink>
            <NavLink>FOODS</NavLink>
            <NavLink>UPLOAD FOOD</NavLink>
        </Sidebar>
    )
}

export default AdminPanel
